import React from 'react';
import fotoPerfil from '../img/fotoAndre.JPG';

class Navigation extends React.Component {
  render() {
    return (
      <div class="all">
      <section class="init">
        <nav class="header">
          <ul data-testid ="mainNav">
            <li>Hom</li>
            <li>Sobre</li>
            <li>Seri√ßos</li>
            <li>Experiencias</li>
            <li>Trabalhos</li>
            <li>Blog</li>
            <li>Contato</li>
          </ul>
        </nav>
      </section>
      <main class="content">
        <img src={fotoPerfil} alt="fotoPerfil" class="fotoPerfil"/>
      </main>
    </div>
    )
  }
}

export default Navigation;
